def get_menu_items(controller):
    """Returns application menu items with special class for active menu item."""
    return (
        {'url': reverse('albums:album_index'), 'label': _('menu.albums'), 'id': 'menu_album', 'class': 'activeMenuItem' if controller == 'album' else ''},
        {'url': reverse('albums:report_edit'), 'label': _('menu.report'), 'id': 'menu_report', 'class': 'activeMenuItem' if controller == 'report' else ''})


def json_default(obj):
    """Serializes decimal and date values, can be used for json encoder."""
    if isinstance(obj, decimal.Decimal):
        return float(obj)
    if isinstance(obj, datetime.date):
        return str(obj)
    raise TypeError
